      \ Please see below for our response.\tOur committee is aware of the best efforts
      standard established by the Commission and does have in place a system that
      meets that standard.  All of our original solicitations have the request for
      employer and occupation information on them.  For the donors that do not provide
      that information, we automatically send them a written request for it within
      30 days.  This follow up does not request any additional monies and contains
      a self addressed envelope.  Finally, we add the new information to our database
